        <div className="rectangle06 h-none" style={{ width: 175 }} />
        <div className="taper rectangle07" style={{ borderColor: '#27CA75 transparent', width: '180px' }}><p className='funnelPara text-center text-white'>Conversion</p></div>
    </div>}
    </>
  ) 
}
